import React from "react";
import { useMemo } from "react";
import checkPieces from "../../scripts/pieces";

const HomePage = () => {
    console.log(checkPieces("IJS", "[IJLS]!")); // false (queue does not match length)
    console.log(checkPieces("JSLI", "[IJLS]!")); // true
    console.log(checkPieces("TIZ", "TI")); // false (extra pieces)
    console.log(checkPieces("IJLST", "[IJLS]!")); // false (extra pieces)
    
    console.log(checkPieces("TISTSO", "[TIJLS]p3[TOS]!")); // true
    console.log(checkPieces("TSSTOS", "[TIJLS]p3[TOS]!")); // false (duplicate pieces)
    console.log(checkPieces("TZSTOS", "[TIJLS]p3[TOS]!")); // false (z not in the first bag)
    

    return <></>;
};

export default HomePage;
